");
                WriteLiteral(@"        
        <div class=""home-content"">
            <div class=""row home-content__main"">
                <h1>
                Olá a todos, me chamo<br>
                Nicolas Plaisant
                </h1>

                <p>
                Estudante de Tecnologia e atual estagiário<br>
                da GFT Group, em Curitiba - Brasil.
                </p>
            </div> 

        </div> 

        <ul class=""home-sidelinks"">
            <li><a class=""smoothscroll"" href=""#about"">Sobre<span>Quem sou eu</span></a></li>
            <li><a class=""smoothscroll"" href=""#services"">Atividades<span>O que faço</span></a></li>
            <li><a  class=""smoothscroll"" href=""#contact"">Contato<span>Entre em contato</span></a></li>
        </ul> 

        <ul class=""home-social"">
            <li class=""home-social-title"">Me siga nas redes sociais</li>
